Typescript: deep keyof of a nested object, with related type<p>I'm looking for a way to have all keys / values pair of a nested object.</p>
<p>(For the autocomplete of MongoDB dot notation key / value type)</p>
<pre><code>interface IPerson {
    name: string;
    age: number;
    contact: {
        address: string;
        visitDate: Date;
    }
}
</code></pre>
<p>Here is what I want to achieve, to make it becomes:</p>
<pre><code>type TPerson = {
    name: string;
    age: number;
    contact: { address: string; visitDate: Date; }
    &quot;contact.address&quot;: string;
    &quot;contact.visitDate&quot;: Date;
}
</code></pre>
<h2>What I have tried:</h2>
<p>In this <a href="https://stackoverflow.com/a/58436959/681830">answer</a>, I can get the key with <code>Leaves&lt;IPerson&gt;</code>.
So it becomes <code>'name' | 'age' | 'contact.address' | 'contact.visitDate'</code>.</p>
<p>And in another <a href="https://stackoverflow.com/a/61648690/681830">answer</a> from @jcalz, I can get the deep, related value type, with <code>DeepIndex&lt;IPerson, ...&gt;</code>.</p>
<p>Is it possible to group them together, to become type like <code>TPerson</code>?</p>
<h2>Modified 9/14: The use cases, need and no need:</h2>
<p>When I start this question, I was thinking it could be as easy as something like <code>[K in keyof T]: T[K];</code>, with some clever transformation. But I was wrong. Here is what I need:</p>
<h2><strong>1. Index Signature</strong></h2>
<p>So the interface</p>
<pre><code>interface IPerson {
    contact: {
        address: string;
        visitDate: Date;
    }[]
}
</code></pre>
<p>becomes</p>
<pre><code>type TPerson = {
    [x: `contact.${number}.address`]: string;
    [x: `contact.${number}.visitDate`]: Date;
    contact: {
        address: string;
        visitDate: Date;
    }[];
}
</code></pre>
<p>No need to check for valid <code>number</code>, the nature of Array / Index Signature should allow any number of elements.</p>
<h2><strong>2. Tuple</strong></h2>
<p>The interface</p>
<pre><code>interface IPerson {
    contact: [string, Date]
}
</code></pre>
<p>becomes</p>
<pre><code>type TPerson = {
    [x: `contact.0`]: string;
    [x: `contact.1`]: Date;
    contact: [string, Date];
}
</code></pre>
<p>Tuple should be the one which cares about valid index numbers.</p>
<h2><strong>3. Readonly</strong></h2>
<p><code>readonly</code> attributes should be removed from the final structure.</p>
<pre><code>interface IPerson {
    readonly _id: string;
    age: number;
    readonly _created_date: Date;
}
</code></pre>
<p>becomes</p>
<pre><code>type TPerson = {
    age: number;
}
</code></pre>
<p>The use case is for MongoDB, the <code>_id</code>, <code>_created_date</code> cannot be modified after the data has been created. <code>_id: never</code> is not working in this case, since it will block the creation of <code>TPerson</code>.</p>
<h2><strong>4. Optional</strong></h2>
<pre><code>interface IPerson {
    contact: {
        address: string;
        visitDate?: Date;
    }[];        
}
</code></pre>
<p>becomes</p>
<pre><code>type TPerson = {
    [x: `contact.${number}.address`]: string;
    [x: `contact.${number}.visitDate`]?: Date;
    contact: {
        address: string;
        visitDate?: Date;
    }[];
}
</code></pre>
<p>It's sufficient just to bring the optional flags to transformed structure.</p>
<h2><strong>5. Intersection</strong></h2>
<pre><code>interface IPerson {
    contact: { address: string; } &amp; { visitDate: Date; }
}
</code></pre>
<p>becomes</p>
<pre><code>type TPerson = {
    [x: `contact.address`]: string;
    [x: `contact.visitDate`]?: Date;
    contact: { address: string; } &amp; { visitDate: Date; }
}
</code></pre>
<h2><strong>6. Possible to Specify Types as Exception</strong></h2>
<p>The interface</p>
<pre><code>interface IPerson {
    birth: Date;
}
</code></pre>
<p>becomes</p>
<pre><code>type TPerson = {
    birth: Date;
}
</code></pre>
<p>not</p>
<pre><code>type TPerson = {
    age: Date;
    &quot;age.toDateString&quot;: () =&gt; string;
    &quot;age.toTimeString&quot;: () =&gt; string;
    &quot;age.toLocaleDateString&quot;: {
    ...
}
</code></pre>
<p>We can give a list of Types to be the end node.</p>
<h2>Here is what I don't need:</h2>
<ol>
<li>Union. It could be too complex with it.</li>
<li>Class related keyword. No need to handle keywords ex: private / abstract .</li>
<li>All the rest I didn't write it here.</li>
</ol>

